func (gc *GenerationCreate) OnConflictColumns(columns ...string) *GenerationUpsertOne {
	gc.conflict = append(gc.conflict, sql.ConflictColumns(columns...))
	return &GenerationUpsertOne{
		create: gc,
	}
}

